INSERT INTO `general_notes` VALUES (1,27,'2022-11-02 21:07:08','2022-11-02 21:07:08','Use big gate on side of house to not bother the dog'),(2,27,'2022-11-02 21:07:28','2022-11-02 21:07:28','Make sure to empty all baskets'),(3,27,'2022-11-02 21:08:02','2022-11-02 21:08:02','They are nice people but they are likely watching the pool'),(4,87,'2022-11-09 15:03:44','2022-11-09 15:03:44','Wireless antenna - 520341 - 600$ my cost. Have to order it from pantair.'),(5,24,'2022-11-09 17:00:32','2022-11-09 17:00:32','My pool fence section was left open from yesterday. He needs to use the real gate at the sidewalk by the skimmer. It is more easily shut.'),(6,89,'2022-11-14 17:41:08','2022-11-14 17:41:08','Get debris along pool edge'),(7,89,'2022-11-14 17:41:27','2022-11-14 17:41:27','Leave pump running when you leave'),(8,89,'2022-11-14 17:41:40','2022-11-14 17:41:40','Dog is friendly'),(9,89,'2022-11-14 17:42:01','2022-11-14 17:42:01','Set pump for 6 hours'),(10,100,'2023-02-28 20:04:53','2023-02-28 20:04:53','- Has a Dog named Penny who is friendly\n- Gate should always be unlocked\n- This is a rental and their names are Joe and Jenny Dominiak\n- Pool is easy');
